Title: Collapse AKA Collapse Of The Living Dead 2010

Plot: The normal worries of a struggling small town farmer are blown away 
when the world is suddenly overrun by undead monsters. How can a good 
man protect and provide for his family in a hostile world without becoming a 
monster himself?

Genre: Horror | Thriller
IMDB rating: 5.5/10 from 12 users
Directed by: Jason Bolinger, Insane Mike Saunders
Starring: Chris Mulkey, Karen Landry and Travis Slade Reinders

